import React from "react";

const BusBookingPage = () => {
  return (
    <div className="p-6 bg-white shadow-md rounded-lg">
      <div className="text-3xl font-medium text-gray-900 mb-3">
        Bus Booking Information
      </div>
      <div className="text-gray-500 mb-5">
        View and manage your bus booking details below.
      </div>
      <ul className="list-none p-0 m-0">
        <li className="flex items-center py-3 px-2 border-t border-gray-200 flex-wrap">
          <div className="text-gray-500 w-full md:w-1/4 font-medium">
            Bus Number
          </div>
          <div className="text-gray-900 w-full md:w-2/3">BUS001</div>
          <div className="w-full md:w-1/12 flex justify-end">
            <button className="text-blue-600 hover:text-blue-800">Edit</button>
          </div>
        </li>
        <li className="flex items-center py-3 px-2 border-t border-gray-200 flex-wrap">
          <div className="text-gray-500 w-full md:w-1/4 font-medium">Route</div>
          <div className="text-gray-900 w-full md:w-2/3">
            <span className="bg-blue-100 text-blue-800 text-xs font-medium mr-2 px-2.5 py-0.5 rounded">
              New York
            </span>
            <span className="bg-blue-100 text-blue-800 text-xs font-medium mr-2 px-2.5 py-0.5 rounded">
              Washington D.C.
            </span>
          </div>
          <div className="w-full md:w-1/12 flex justify-end">
            <button className="text-blue-600 hover:text-blue-800">Edit</button>
          </div>
        </li>
        <li className="flex items-center py-3 px-2 border-t border-gray-200 flex-wrap">
          <div className="text-gray-500 w-full md:w-1/4 font-medium">
            Departure Time
          </div>
          <div className="text-gray-900 w-full md:w-2/3">
            09:00 AM, June 15, 2023
          </div>
          <div className="w-full md:w-1/12 flex justify-end">
            <button className="text-blue-600 hover:text-blue-800">Edit</button>
          </div>
        </li>
        <li className="flex items-center py-3 px-2 border-t border-gray-200 flex-wrap">
          <div className="text-gray-500 w-full md:w-1/4 font-medium">
            Arrival Time
          </div>
          <div className="text-gray-900 w-full md:w-2/3">
            02:00 PM, June 15, 2023
          </div>
          <div className="w-full md:w-1/12 flex justify-end">
            <button className="text-blue-600 hover:text-blue-800">Edit</button>
          </div>
        </li>
        <li className="flex items-center py-3 px-2 border-t border-b border-gray-200 flex-wrap">
          <div className="text-gray-500 w-full md:w-1/4 font-medium">
            Seat Number
          </div>
          <div className="text-gray-900 w-full md:w-2/3">A23 (Window Seat)</div>
          <div className="w-full md:w-1/12 flex justify-end">
            <button className="text-blue-600 hover:text-blue-800">Edit</button>
          </div>
        </li>
      </ul>
    </div>
  );
};

export default BusBookingPage;
